import React, { useState } from 'react'
import { Link } from 'react-router-dom';
import { NavTopics } from './NavTopics';
import { Button, Navbar, Container, NavItem } from 'react-bootstrap';


const Navbaar = ()=>{ 

    const navItems = NavTopics.map(
        (i)=>{
            return (
                <NavItem>
                    <Link className={i.class} to={i.path} style={{textDecoration:'none'}}>
                            <span className="font-weight-bold">{i.label}</span>
                    </Link>
                </NavItem>
            )
        }
    )

    return (
        <div>
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark" fixed='top' style={{top: '0'}}>
                    {navItems}
            </Navbar>
        </div>
            ) 

}

export default Navbaar;
